import React, { useState, useEffect } from 'react';
import authService from '../../services/authService';

import CrearTarea from './CrearTarea';
import SubirRecurso from './SubirRecurso';
import CalificarTarea from './CalificarTarea';
import TomarAsistencia from './TomarAsistencia';
import AsignaturasDisponibles from './AsignaturasDisponibles';
import './profesorCss/profesor.css';


const ProfesorDashboard = () => {
    const [user, setUser] = useState(null);
    const [selectedOption, setSelectedOption] = useState('');
    const [asignaturas, setAsignaturas] = useState([]);
    const [asignaturaSeleccionada, setAsignaturaSeleccionada] = useState(null);

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const userData = await authService.getUserData(); // Función para obtener datos del usuario
                setUser(userData);
            } catch (error) {
                console.error("Error al obtener datos del usuario:", error);
                // Manejar el error, por ejemplo, redirigiendo al login
            }
        };
        fetchUserData();
    }, []);

    const handleMenuClick = (option) => {
        setSelectedOption(option);
    };

    if (!user) {
        return <div>Cargando...</div>;
    }

    return (
        <div className="dashboard-container">
            <div className="sidebar">
                <nav className="menu">
                    <ul>
                        <li>
                            <button onClick={() => handleMenuClick('tareas')}>Tareas</button>
                            {selectedOption === 'tareas' && (
                                <ul className="submenu">
                                    <li><button onClick={() => handleMenuClick('crearTarea')}>Crear Tarea</button></li>
                                    <li><button onClick={() => handleMenuClick('calificarTarea')}>Calificar Tarea</button></li>
                                </ul>
                            )}
                        </li>
                        <li>
                            <button onClick={() => handleMenuClick('recursos')}>Recursos</button>
                            {selectedOption === 'recursos' && (
                                <ul className="submenu">
                                    <li><button onClick={() => handleMenuClick('subirRecurso')}>Subir Recurso</button></li>
                                </ul>
                            )}
                        </li>
                        <li>
                            <button onClick={() => handleMenuClick('asistencia')}>Asistencia</button>
                            {selectedOption === 'asistencia' && (
                                <ul className="submenu">
                                    <li><button onClick={() => handleMenuClick('tomarAsistencia')}>Tomar Asistencia</button></li>
                                </ul>
                            )}
                        </li>
                    </ul>
                </nav>
            </div>
            <div className='main-content'>
                <div className='header'>
                    <h1>Bienvenido, {user.nombre}</h1>
                    <button onClick={authService.cerrarSesion}>Cerrar Sesión</button>
                </div>
                <div className='content'>
                    {selectedOption === 'tareas' && (
                        <div className='tareas-container'>
                            <h2>Gestión de Tareas</h2>
                            <CrearTarea />
                            <CalificarTarea />
                        </div>
                    )}
                    {selectedOption === 'recursos' && (
                        <div className='recursos-container'>
                            <h2>Gestión de Recursos</h2>
                            <SubirRecurso />
                        </div>
                    )}
                    {selectedOption === 'asistencia' && (
                        <div className='asistencia-container'>
                            <h2>Gestión de Asistencia</h2>
                            <TomarAsistencia />
                        </div>
                    )}
                    <AsignaturasDisponibles
                        asignaturas={asignaturas}
                        setAsignaturas={setAsignaturas}
                        asignaturaSeleccionada={asignaturaSeleccionada}
                        setAsignaturaSeleccionada={setAsignaturaSeleccionada}
                    />
                    </div>
                    </div>
        </div>
    );
};

export default ProfesorDashboard;
